import React, { Component } from "react";
import { Grid, Cell} from "react-mdl";

class About extends Component {
  render() {
    return (
      <div className="info">
        <Grid className="grid">
          <Cell col={6}>

          </Cell>
          <Cell col={6}>
            <h2>Focus</h2>
            <hr />
            <p>Aimed to align polish web design functionality to meet clientele expectations by optimizing web-based potential and brand consistency</p>

          </Cell>

          <Cell col={6}>
            <h2>Skills</h2>
            <hr />

           <p>Suitably equipped with transferrable skills and progressive working experiences in public and private sector.</p>
          </Cell>

          <Cell col={6}>
            <h2>Experience</h2>
            <hr />
            <p>Experience spanned across international geographical borders in multidiscipline and diverse cultural settings</p>


          </Cell>
        </Grid>
      </div>
    );
  }
}

export default About;
